import "../Css-files/home.css"

export default function Home() {
  return (

    <div>  

    <h1 className="title"> Looking for a specific food or destination? Let TravelEat help!</h1>

    <div className="container"> 

    <input id="firstSearchField" class="searchContainer" type="text" placeholder="Food or Destination"></input>

    <input type="image" className="searchContainer" src="https://cdn.onlinewebfonts.com/svg/img_277498.png"></input>
    <input id="secondSearchField" class="searchContainer" type="text" placeholder="Food or Destination"></input>

    <button id="findButton" class="searchButton" href="" type="button">Find</button>
    </div>

    </div> 









  );
}
